import { Component } from 'react'

class Tags extends Component {
    constructor(props) {
    super(props)
    this.state = {
        tags: this.props.tags
    }
}

    render(){
        const tags = this.state.tags

        return(<ul>
                {tags.map((tag) => (<li>{tag}</li>))}
        </ul>
        )
    }
}

export default Tags
